import React from 'react'
import { Form, FormControl, FormGroup, FormLabel, Row } from 'react-bootstrap'

export default function Contact() {
  return (
        <Form>
            <Row>
                <FormGroup>
                    <FormLabel>Name</FormLabel>
                    <FormControl type='text' placeholder='Enter name'/>
                </FormGroup> 
            </Row>
        </Form>
  );
}
